script: |
  super -f text -I q12005.spq | sort > q12005.out

inputs:
  - name: q12005.spq
    data: |
      SELECT DISTINCT - col0 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE col0 NOT BETWEEN + - col1 * 81 - CAST ( + col0 AS INTEGER ) + - col1 AND NULL;
  - name: tab0

outputs:
  - name: q12005.out
    data: |
